const Index = ()=>{
    const [message,setMessage] = useState({
        text:"hello",
        id:"orifnrf"
    })
    return (
        <>
            <form>
                <input 
                text="text"
                name="message"
                id="message"
                value={message.text}
                />
            </form>
        </>
    )
}
export default Index;
